const Insights = () => {
    return (
        <div>
            <div className="box1">
                <div className="box2">
                    <div className="AI-header1">
                    </div>
                </div>
            </div>
            <style jsx>{`
            .box1 {
                position: absolute;
                width: 1340px;
                height: 677px;
                left: 0px;
                top: 3081px;
                background-color: gray;
            }
            .box2 {
                position: absolute;
                width: 500px;
                height: 580px;
                left: 94px;
                top: 393px;
                background: green;
                box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.15);
            }
            .AI-header1 {
                position: absolute;
                width: 500px;
                height: 283px;
                left: 0px;
                top: 0px;
                background-color: red;
            }
            .box3 {
                position: absolute;
                width: 427px;
                height: 117px;
                left: 130px;
                top: 3683px;
                background: #FFFFFF;
            }
            `}
            </style>
        </div>
    )
}
export default Insights
